-- 3: CareSite. Two records with same condition_concept_id are less than 30 days apart, one condition_era record created. Id is PERSON_ID.
-- 5: CareSite. Two records with same condition_concept_id are more than 30 days apart, two condition_era records created. Id is PERSON_ID.
