-- 13: Cost. Patient has procedure with domain = measurement, measurement record created. Id is PERSON_ID.
-- 15: Cost. Patient has procedure with domain = observation, observation record created. Id is PERSON_ID.
-- 17: Cost. Patient has cost values and revenue code, cost is correctly associated with cost_domain_id = 10. Id is PERSON_ID.
-- 19: Cost. Testing DRG Populates (HIX-1431). Id is PERSON_ID.
-- 21: Cost. Patient has cost values, cost is correctly associated with the right event_id (HIX-1515).
